import { useState } from "react";
import avatar from "../img/img_avatar.png";

function TopNav() {
  const [loggedUser, setLoggedUser] = useState({
    name: "Pedro",
  });

  return (
    <div className="TopNav absolute">
      <nav className="flex justify-end w-screen py-6 px-12">
        <div className="flex flex-row items-center cursor-pointer">
          <img src={avatar} className="w-10 rounded-full" alt="Avatar" />
          <div className="flex flex-row items-center pl-3">
            <span className="text-sm text-gray-800">{loggedUser.name}</span>
            <a className="material-symbols-rounded text-xl pl-1">expand_more</a>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default TopNav;
